"use strict";

// GetFromID

function GetFromID(i) {return document.getElementById(i);}

// GetFromClassName

function GetFromClassName(i){return document.getElementsByClassName(i);}

// WriteHtml

function WriteHtml(i) {document.write(i)} 

// GetFromName

function GetFromName(i){return document.getElementsByName(i);}
// GetFromTagName

function GetFromTagName(i){document.getElementsByTagName(i)};

// Print

function Print(i) {console.log(i)};

// Warn
function Warn(i) {console.warn(i)};

// HtmlBody

function HtmlBody(i) {document.body};

// BodyStyle

function BodyStyle(){document.body.style};

// CreateAudio 

function CreateAudio(i,e){var i = new Audio(e)};

// WReload

function WReload(){window.location.reload()};

// URLReplace

function URLReplace(i){window.location.replace(i)};
